import { Button, Stack } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function Header() {
    return (
        <header>
            <div className="logo">
            </div>
            <div className="search">
                {/* 검색 영역 컴포넌트를 추가 */}
            </div>
            <div className="login">
                {/* 로그인 컴포넌트를 추가 */}
            </div>
            <div className="my-page">
                {/* 마이페이지 컴포넌트를 추가 */}
            </div>
        </header>
    )
}

export default Header;
